const client = new ApolloClient({
  uri: '/graphql',
  cache: new InMemoryCache(),
});
function App() {

  const [isLoggedIn, setIsLoggedIn ] = useState(false);
  return (
    <ApolloProvider client={client}>
    <div className="App">
      <NavBar testLogIn = {setIsLoggedIn} />

      {isLoggedIn ? <OrderPage /> : <Login />}

      <Footer />

    </div>
    </ApolloProvider>
  );
}

export default App;
